class Solution:
    def count(self, num1: str, num2: str, min_sum: int, max_sum: int) -> int:
        MOD = 10**9 + 7

        def dfs(pos, tight, less, s, dp, digits):
            if pos == len(digits): return min_sum <= s <= max_sum
            if not tight and not less and dp[pos][s] != -1: return dp[pos][s]
            ans = 0
            up = digits[pos] if tight else 9
            for i in range(up + 1):
                ans += dfs(pos + 1, tight and i == up, less or i > 0, s + (i if less or i > 0 else 0), dp, digits)
                ans %= MOD
            if not tight and not less: dp[pos][s] = ans
            return ans

        def solve(x):
            digits = [int(d) for d in x]
            dp = [[-1 for _ in range(max_sum + 1)] for _ in range(len(x) + 1)]
            return dfs(0, True, False, 0, dp, digits)

        return (solve(num2) - solve(str(int(num1) - 1))) % MOD
